import React, { Component } from 'react'

export default class SignIn extends Component {

    state = {
        firstName: '',
        lastName: '',
        userName: '',
        password: '',
        confirmedPassword: ''
    }

    handleChange = (e) => {

        console.log(e.target.value)
    }
    render() {
        return (
            <div>
                <form>
                   <input placeholder='First Name' value={this.state.firstName} onChange={this.handleChange}/>
                   <input placeholder='Last Name' value={this.state.lastName} />
                   <input placeholder='User Name' value={this.state.userName} />
                   <input placeholder='Password' value={this.state.password} />
                   <input placeholder='Confirm Password' value={this.state.confirmedPassword} />
                </form>
            </div>
        )
    }
}
